import { Grid, List, Typography, ListItem, ListItemAvatar, Avatar, ListItemText, Divider, Select } from '@material-ui/core';
import { useState } from 'react';
import useStyles from './useStyles';
const AssignDriver = (): JSX.Element => {
    const { root, select } = useStyles();

    const [value, setValue] = useState();

    const handleClick = () => {
        console.log('menu has been clicked')
    }
    return (
        <>
            <Grid container direction="column" className={root} >
                <Grid item>
                    <Typography>
                        Please Select Driver
                    </Typography>
                    <Select
                        id="businessType"
                        name="businessType"
                        autoWidth
                        MenuProps={{
                            anchorOrigin: {
                                vertical: "bottom",
                                horizontal: "left"
                            },
                            transformOrigin: {
                                vertical: "top",
                                horizontal: "left"
                            },
                            getContentAnchorEl: null
                        }}
                        value={'1'}
                        onChange={() => {console.log('th value is: ')}}
                        classes={{ select: select }}
                    >
                        {/* <MenuItem value={'hotel'}>Hotel</MenuItem>
                        <MenuItem value={'restaurant'}>Restaurant</MenuItem>
                        <MenuItem value={'other'}>Other</MenuItem> */}
                        <List style={{ width: '100%', maxWidth: 360, backgroundColor: 'background.paper' }}>
                            <ListItem alignItems="flex-start" value={'sdas'}>
                                <ListItemAvatar>
                                    <Avatar alt="Remy Sharp" src="https://airportshuttle0.s3.amazonaws.com/defaultAvatar.png" />
                                </ListItemAvatar>
                                <ListItemText
                                    primary="Brunch this weekend?"
                                    secondary={
                                        <>
                                        <Typography
                                            style={{ display: 'inline' }}
                                            component="span"
                                            variant="body2"
                                        >
                                            Ali Connors
                                        </Typography>
                                        {" — I'll be in your neighborhood doing errands this…"}
                                        </>
                                        }
                                        />
                            </ListItem>
                        <Divider variant="inset" component="li" />
                        <ListItem alignItems="flex-start" value={'2'}>
                                <ListItemAvatar>
                                    <Avatar alt="Remy Sharp" src="https://airportshuttle0.s3.amazonaws.com/defaultAvatar.png" />
                                </ListItemAvatar>
                                <ListItemText
                                    primary="Brunch this weekend?"
                                    secondary={
                                        <>
                                        <Typography
                                            style={{ display: 'inline' }}
                                            component="span"
                                            variant="body2"
                                        >
                                            Ali Connors
                                        </Typography>
                                        {" — I'll be in your neighborhood doing errands this…"}
                                        </>
                                        }
                                        />
                            </ListItem>
                        </List>
                    </Select>
                </Grid>
            </Grid>
        </>
    );
};

export default AssignDriver;
